import React from 'react';
import { Link } from 'react-router-dom';

export default function Home() {
  return (
    <div className="min-h-screen bg-gradient-to-r from-indigo-500 to-blue-400 flex items-center justify-center">
      <div className="bg-white shadow-2xl rounded-2xl p-10 max-w-lg w-full text-center">
        <h1 className="text-4xl font-extrabold mb-8 text-indigo-600">Bienvenue sur mon app</h1>
        <div className="flex justify-center gap-6">
          <Link to="/client" className="bg-indigo-500 hover:bg-indigo-600 text-white px-8 py-3 rounded-lg font-semibold transition">Client</Link>
          <Link to="/admin" className="bg-gray-200 hover:bg-gray-300 text-gray-800 px-8 py-3 rounded-lg font-semibold transition">Admin</Link>
        </div>
      </div>
    </div>
  );
}
